import React from "react";
import {Dropdown} from "reactstrap";

export default class userButton extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: ""
        }
    }

    render() {
        return(
            <div>
                <Dropdown>
                    <Dropdown.Toggle variant="success" id="dropdown-basic">
                        {this.props.name}
                    </Dropdown.Toggle>

                    <Dropdown.Menu>
                        <Dropdown.Item onClick={this.props.onClick}>Tanca sessi√≥</Dropdown.Item>
                    </Dropdown.Menu>
                </Dropdown>
            </div>
        )
    }
}
